import React from 'react';

class Map2 extends React.Component {
    constructor() {
        super();

    }
    render () {
        return (
            <React.Fragment>
            <h2>form practice</h2>
            <form>
                <input type="text" name="text1"></input>
                <label>text1</label>
                <input type="text" name="text2"></input>
                <label>text2</label>
                <input type="text" name="text3"></input>
                <label>text3</label>
            </form>
        </React.Fragment>

        )
    }     


}

export default Map2
